import './App.css';   
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'
import History from './components/History';
import Shortner from './components/Shortner';
import Shortnerresult from './components/Shortnerresult';
import Background from './components/Background';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';


function App() {
  return (
    <div className="App">
      <BrowserRouter>

          <Navbar bg="light" expand="lg">
            <Container fluid>

              <Navbar.Toggle aria-controls="navbarScroll" />

                <Navbar.Collapse id="navbarScroll">
                    <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }} >           
                        <Nav.Link className='Home'><Link to="/" > Home </Link></Nav.Link>
                        <Nav.Link className='History'><Link to="/History" > History </Link></Nav.Link>
                    </Nav> 
                </Navbar.Collapse>
            </Container>
          </Navbar>

        <Routes>

            <Route path="/" element={<Shortner />} />
            <Route path="/History" element={<History />} />
            <Route path='/Shortnerresult' element={<Shortnerresult/>}/>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
